import {useSelector} from 'react-redux'

function Thoughts() {
  const thoughts = useSelector(state => state.thought.thoughts)
  return (
    <div className="thoughts">
      {
        thoughts.map(thought => {
          <div>
            <p>{thought.title}</p>
            <p>{thought.content}</p>
          </div>
        })
      }
    </div>
  )
}

export default Thoughts
